package Array;

public class Multidimarray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a[][]= {{2,5,6},{3,6,9}};
{
	System.out.println(a[1][1]);			//i=1,j=1
}
{
	System.out.println("----------");
}
for(int i=0;i<=1;i++)
{
	for(int j=0;j<=2;j++)
	{
		
		System.out.print(" "+a[i][j]);
	}
	System.out.println();
		
}
	}

}
